import React from 'react'

class Input extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <>
                <h2>Test Inputs</h2>
                <form>
                    <div>
                        <input placeholder="Digite seu e-mail" />
                    </div>
                    <div>
                        <input placeholder="Digite sua senha" />
                    </div>

                </form>
            </>
        );
    }


}

export default Input
